    <div className="auth-screen">
      <MiniBlock className="login-screen__form">
        <MiniBlockTitle>Логин</MiniBlockTitle>
        

        <MiniBlockForm>
          <MiniBlockInput onChange={() => {}} placeHolder="Логин" />
          <MiniBlockInput onChange={() => {}} placeHolder="Пароль" />
        </MiniBlockForm>
      </MiniBlock>
    </div>
  );
}
